uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0; // Background Texture
uniform sampler2D iChannel1; // Object Texture

// Parameters defined in the JSON
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;
uniform float u_reflection_strength;
uniform float u_floor_height;
uniform float u_reflection_falloff;
uniform float u_nebula_scale;
uniform float u_star_intensity;
uniform float u_star_threshold;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Tri-planar mapping for texture application on SDFs
vec3 triplanar(sampler2D tex, vec3 p, vec3 n) {
    vec3 m = pow(abs(n), vec3(10.0));
    m /= (m.x + m.y + m.z);
    vec3 x = texture(tex, p.zy * 0.2).xyz;
    vec3 y = texture(tex, p.xz * 0.2).xyz;
    vec3 z = texture(tex, p.xy * 0.2).xyz;
    return x * m.x + y * m.y + z * m.z;
}

// --- BACKGROUND GENERATION ---
float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    float a = hash(i);
    float b = hash(i + vec2(1.0, 0.0));
    float c = hash(i + vec2(0.0, 1.0));
    float d = hash(i + vec2(1.0, 1.0));
    vec2 u = f * f * (3.0 - 2.0 * f);
    return mix(a, b, u.x) + (c - a) * u.y * (1.0 - u.x) + (d - b) * u.x * u.y;
}

vec3 getSky(vec3 rd) {
    float time = iTime * u_speed * 0.1;
    // Layered noise for nebula
    vec2 uv = rd.xy / (abs(rd.z) + 0.5);
    float n = noise(uv * 2.0 * u_nebula_scale + time);
    n += noise(uv * 4.0 * u_nebula_scale - time) * 0.5;

    // Use the palette for background consistency
    vec3 nebulaColor1 = vec3(0.1, 0.05, 0.2);
    vec3 nebulaColor2 = vec3(0.0, 0.15, 0.25);
    vec3 sky = mix(nebulaColor1, nebulaColor2, n);

    // Stars - Increased power makes them much sparser
    float stars = pow(hash(rd.xy * 450.0), u_star_threshold) * u_star_intensity;
    sky += stars;

    // Blend with iChannel0 for extra detail
    vec3 texBG = texture(iChannel0, rd.xy * 0.5 + 0.5).rgb;
    return sky + texBG * 0.1;
}

// --- SHAPES ---
float sdInfinityBowtie(vec3 p) {
    float t = iTime * u_speed * 0.5;
    p.xz *= rot(p.y * 0.5 + t);
    float angle = atan(p.x, p.z);
    float dist = length(p.xz);
    float r1 = 2.5; 
    float r2 = 0.4 + 0.3 * cos(angle * 2.0);
    p.y += sin(angle * 2.0 + t) * 0.5;
    vec2 q = vec2(dist - r1, p.y);
    return length(q) - r2;
}

float sdFloor(vec3 p) {
    return p.y - u_floor_height;
}

// Scene Map
vec2 map(vec3 p) {
    float d1 = sdInfinityBowtie(p);
    float d2 = sdInfinityBowtie(p * 1.5) / 1.5;
    float bowtie = smin(d1, d2, 0.5);

    float floorDist = sdFloor(p);

    if (bowtie < floorDist) return vec2(bowtie, 0.0);
    return vec2(floorDist, 1.0);
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.005, 0.0);
    return normalize(vec3(
        map(p + e.xyy).x - map(p - e.xyy).x,
        map(p + e.yxy).x - map(p - e.yxy).x,
        map(p + e.yyx).x - map(p - e.yyx).x
    ));
}

// Color Palette
vec3 getPalette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d + iTime * 0.1));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed;

    // CAMERA
    float angle = time * 0.2;
    vec3 ro = vec3(sin(angle) * u_camera_dist, cos(angle * 0.5) * 1.5 + 1.0, cos(angle) * u_camera_dist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    // RAYMARCHING
    float t = 0.0;
    float glow = 0.0;
    vec2 res;
    vec3 p;

    for(int i = 0; i < 100; i++) {
        p = ro + rd * t;
        res = map(p);
        if(res.x < 0.0) glow += 0.02;
        glow += 0.02 / (0.05 + abs(res.x));
        if(abs(res.x) < 0.001 || t > 40.0) break;
        t += res.x * 0.7;
    }

    // Get improved procedural background
    vec3 bgCol = getSky(rd);
    vec3 col = bgCol;

    if(t < 40.0) {
        vec3 n = getNormal(p);
        vec3 lightPos = vec3(5.0, 10.0, 5.0);
        vec3 l = normalize(lightPos - p);
        float diff = max(dot(n, l), 0.0);
        float fresnel = pow(1.0 - max(dot(n, -rd), 0.0), 5.0);

        if (res.y < 0.5) {
            vec3 objTex = triplanar(iChannel1, p, n);
            vec3 baseCol = getPalette(p.y * 0.2 + time * 0.1) * objTex;
            col = baseCol * diff + fresnel * baseCol * 2.0;
        } else {
            vec3 floorBase = vec3(0.02, 0.02, 0.03); // Darker floor

            vec3 refRd = reflect(rd, n);
            vec3 refRo = p + n * 0.01;
            float rt = 0.0;
            vec2 rRes;

            for(int i=0; i<40; i++) {
                rRes = map(refRo + refRd * rt);
                if(abs(rRes.x) < 0.01 || rt > 15.0) break;
                rt += rRes.x;
            }

            vec3 reflectionCol = vec3(0.0);
            if(rt < 15.0 && rRes.y < 0.5) {
                vec3 rp = refRo + refRd * rt;
                vec3 rn = getNormal(rp);
                vec3 rTex = triplanar(iChannel1, rp, rn);
                reflectionCol = getPalette(rp.y * 0.2 + time * 0.1) * rTex;
                reflectionCol *= exp(-u_reflection_falloff * rt);
            } else {
                reflectionCol = getSky(refRd) * 0.2;
            }

            col = mix(floorBase, reflectionCol, u_reflection_strength);
            col += fresnel * 0.2;
        }

        // Distance Fog mixing with background
        col = mix(col, bgCol * 0.5, 1.0 - exp(-0.02 * t));
    }

    // Apply Glow
    vec3 glowCol = getPalette(time * 0.05) * glow * u_glow_intensity;
    col += glowCol * 0.15;

    // Final Adjustments
    col = pow(col, vec3(0.95)); 

    fragColor = vec4(col, 1.0);
}
